import React, { useEffect, useState } from "react";
import Typography from "@mui/material/Typography";
import { Button, Grid, List, ListItem, ListItemText } from "@mui/material";

import NavBar from "./components/Navbar";
import { Link } from "react-router-dom";
import {
  get,
  child,
  getDatabase,
  query,
  ref,
  set,
  orderByChild,
  remove,
  equalTo,
  onValue,
  orderByKey,
} from "firebase/database";
import "./adminDash.css";
import ManageUsers from "./ManageUsers";

export default function AdminDash({ usrData }) {
  function readUser(){
  const [show, setShow] = useState();

  const usrQueryRef = query(ref(getDatabase(), "blogs"));

  onValue(usrQueryRef, (snapshot) => {
    setShow(snapshot.val());
    console.log(snapshot.val())
  });
  }

  useEffect(()=>{ 
    readUser()
   }, [])
  return (
    <>
      <NavBar />
      <Grid
        container
        sx={{
          padding: "10em 7em 4em",
        }}
      >
        <Grid
          item
          width={"50%"}
          sx={{
            // border: "1em dotted yellow",
            padding: "2em",
          }}
        >
          <div className="admin_widget">
            <List component="nav">
              <ListItem>
                <ListItemText>ADMIN DASHBOARD</ListItemText>
              </ListItem>
              <ListItem button divider className="list_btn">
                <ListItemText primary="View Users" />
              </ListItem>
              <Link to="/signup">
                <ListItem button divider className="list_btn">
                  <ListItemText primary="Add Users" />
                </ListItem>
              </Link>
              <ListItem button divider className="list_btn">
                <ListItemText primary="Check Image" />
              </ListItem>
            </List>
          </div>
        </Grid>
        <Grid
          item
          width={"50%"}
          sx={{
            // border: "1em solid yellow",
            padding: "2em",
          }}
        >
          <ManageUsers  />
        </Grid>
      </Grid>
    </>
  );
}
